function convertirCsvAJson(t){const n=t.split("\n"),o=n[0].split(","),e=[];for(let t=1;t<n.length;t++){const c=n[t].split(",");if(c.length===o.length){const t={};for(let n=0;n<o.length;n++)t[o[n]]=c[n];e.push(t)}}return e}async function resultadoHubCsv(t,n){const o=[];o.length=0;try{const e=await fetch(t),c=await e.text(),s=convertirCsvAJson(c);return s.forEach(t=>{t.hubs.includes(n)&&"a"==t.state.toLowerCase()&&o.push(t)}),o}catch(t){return console.error(t)}}async function resultadoHubJson(t,n){const o=[];o.length=0;try{const e=await fetch(t),c=await e.json();return c.forEach(t=>{t.hubs.includes(n)&&"a"==t.state.toLowerCase()&&o.push(t)}),o}catch(t){return console.error(t)}}function clicksIdsHubs(t){allIndicator.forEach(n=>{n.addEventListener("click",function(){t.includes(".json")?infoProducts(resultadoHubJson(t,n.id),n.id):t.includes(".csv")&&infoProducts(resultadoHubCsv(t,n.id),n.id),clickScrollElelemt(scrollElement)})})}function paginacionObjetos(t){const n=document.querySelector("#content-programs");n.innerHTML="";const o=document.getElementById("content-programs"),e=document.getElementById("template-card").content,c=document.createDocumentFragment();t.forEach(t=>{createCard(t,e,c)}),o.appendChild(c),lazyLoad()}function clickScrollElelemt(t){window.scrollTo({top:t.offsetTop,behavior:"smooth"})}